import React, { Component } from 'react'

class Counter extends Component {

    constructor()
    {
        super()
        this.state = {
            count: 0
        }
    }

    Increment()
    {
        this.setState({
            count: this.state.count+1
        })
    }

    render() {
    return (
      <div>
        <h2> Count - {this.state.count} </h2>
        <button onClick={() => this.Increment()}>Increment</button>
      </div>
    )
  }
}

export default Counter
